import React, {SyntheticEvent, useState} from 'react';

const Signup = () => {
    const [firstName, setFirstName] = useState();
    const [lastName, setLastName] = useState();
    const [username, setUsername] = useState();
    const [password, setPassword] = useState();

    const submit = async (e: SyntheticEvent) => {
        e.preventDefault();

        const response = await fetch('http://localhost:8000/api/signup', {
            method: 'POST',
            headers: {'ContentType' : 'application/json'},
            body: JSON.stringify({
                firstName,
                lastName,
                username,
                password
            })

        });
    }

    return (
        <div>
        <h1 style={{color: "white"}}>SIGN UP</h1>
        <img src="/images/Cognixia.png"/>

        <form onSubmit={submit}>
            <label for="email"></label>
            <input type="text" id="firstName" name="firstName" placeholder="First Name" onChange={e=> setFirstName(e.target.value)} autocomplete="off"></input><br/>
            <label for="email"></label>
            <input type="text" id="lastName" name="lastName" placeholder="Last Name" onChange={e=> setLastName(e.target.value)} autocomplete="off"></input><br/>
            <label for="email"></label>
            <input type="email" id="email" name="email" placeholder="Email" onChange={e=> setUsername(e.target.value)} autocomplete="off"></input><br/>
            <label for="password"></label>
            <input type="password" id="password" name="password" placeholder="Password" onChange={e=> setPassword(e.target.value)} autocomplete="off"></input><br/><br/>
            <input type="submit" value="Submit" />
        </form>
        <div style={{paddingTop: "50px"}}>
            <NavLink  style={{ paddingTop: "100px", fontSize: "2.5em", color: "white", textDecoration: "underline", margin: "50px"}} exact to="/" >Home</NavLink>
        </div>
    </div>
    )

};

export default Signup;

